import React from "react"
import {Routes, Route} from "react-dom"

import './App.css';

function App() {
  return (
    <>

      <Routes>
        <Route path="/" element={ <MainPage /> } />
        <Route path="/auth" element={ <AuthPage /> } />
        <Route path="/airport/:id" element={ <AirportDetailPage /> } />
      </Routes>
    </>
  );
}

export default App;
